import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import DirectoryList from './components/DirectoryList';

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<DirectoryList />} exact />
          {/* Replace other <Route> components inside <Routes> and use `element` prop */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
